import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import Navbar from '../components/Navbar';

export default function Signup() {
  const [credentials, setCredentials] = useState({
    name: "", email: "", password: "", geolocation: "", profilePic: null
  });
  let navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append('name', credentials.name);
    formData.append('email', credentials.email);
    formData.append('password', credentials.password);
    formData.append('location', credentials.geolocation);

    if (credentials.profilePic) {
      formData.append('profilePic', credentials.profilePic);
    }

    try {
      const response = await fetch("http://localhost:5000/api/createuser", {
        method: 'POST',
        body: formData
      });

      const json = await response.json();
      if (!json.success) {
        alert("Enter valid Credentials");
      } else {
        navigate("/login");
      }
    } catch (err) {
      console.error(err);
      alert("An error occurred, please try again.");
    }
  }

  const onChange = (e) => {
    if (e.target.name === "profilePic") {
      setCredentials({ ...credentials, profilePic: e.target.files[0] });
    } else {
      setCredentials({ ...credentials, [e.target.name]: e.target.value });
    }
  }

  return (
    <div style={{ backgroundImage: 'url("https://images.pexels.com/photos/1565982/pexels-photo-1565982.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1")', backgroundSize: 'cover', height: '100vh' }}>
      <div>
        <Navbar />
      </div>

      <div className='container'>
        <form className='w-50 m-auto mt-5 border bg-dark border-success rounded' onSubmit={handleSubmit} encType="multipart/form-data">
          <div className="m-3">
            <label htmlFor="name" className="form-label">Name</label>
            <input type="text" className="form-control" name='name' value={credentials.name} onChange={onChange} aria-describedby="emailHelp" />
          </div>
          <div className="m-3">
            <label htmlFor="email" className="form-label">Email address</label>
            <input type="email" className="form-control" name='email' value={credentials.email} onChange={onChange} aria-describedby="emailHelp" />
          </div>
          <div className="m-3">
            <label htmlFor="geolocation" className="form-label">Location</label>
            <input type="text" className="form-control" name='geolocation' value={credentials.geolocation} onChange={onChange} placeholder="Enter your location" />
          </div>
          <div className="m-3">
            <label htmlFor="password" className="form-label">Password</label>
            <input type="password" className="form-control" value={credentials.password} onChange={onChange} name='password' />
          </div>

          {/* Profile Picture Upload */}
          <div className="m-3">
            <label htmlFor="profilePic" className="form-label">Profile Picture</label>
            <input type="file" className="form-control" name="profilePic" onChange={onChange} />
          </div>

          <button type="submit" className="m-3 btn btn-success">Submit</button>
          <Link to="/login" className="m-3 mx-1 btn btn-danger">Already a user</Link>
        </form>
      </div>
    </div>
  );
}
